import React, { useEffect, useState } from 'react';
import customAxios from './server/customAxios';
import './App.css';

function App() {
  //IP Address 선언
  const [ip, setIp] = useState('');

  //IP Address 값 설정
  function callback(data) {
    setIp(data);
  }

  // 첫번째 렌더링 마친 후 실행
  useEffect(() => {
    //클라이언트의 IP주소를 알아내는 백엔드 함수 호출
    customAxios('/ip', callback);
  }, []);

  return (
    <div className='App'>
      <header className='App-header'>이 기기의 IP주소 == {ip}</header>
    </div>
  );
}

export default App;
